{
struct archive_entry *ae;
struct archive *a;
unsigned char *buff;
int r;

assert((a = archive_read_new()) != NULL);
switch (etype) {
case BZIP2:


if (ARCHIVE_OK != archive_read_support_filter_bzip2(a)) {
skipping("Unsupported bzip2");
assertEqualInt(ARCHIVE_OK, archive_read_free(a));
return;
}
break;
case GZIP:


break;
}
assertA(0 == archive_read_support_filter_all(a));
r = archive_read_support_format_xar(a);
if (r == ARCHIVE_WARN) {
skipping("xar reading not fully supported on this platform");
assertEqualInt(ARCHIVE_OK, archive_read_free(a));
return;
}
assert((buff = malloc(100000)) != NULL);
if (buff == NULL)
return;
memcpy(buff, d, s);
memset(buff + s, 0, 2048);

assertA(0 == archive_read_support_format_all(a));
assertA(0 == archive_read_open_memory(a, buff, s + 1024));
assertA(0 == archive_read_next_header(a, &ae));
assertEqualInt(archive_filter_code(a, 0), ARCHIVE_FILTER_NONE);
assertEqualInt(archive_format(a), ARCHIVE_FORMAT_XAR);
assertEqualInt(archive_entry_is_encrypted(ae), 0);
assertEqualIntA(a, archive_read_has_encrypted_entries(a), ARCHIVE_READ_FORMAT_ENCRYPTION_UNSUPPORTED);

f1(a, ae);
if (f2) {
assertA(0 == archive_read_next_header(a, &ae));
assertEqualInt(archive_filter_code(a, 0), ARCHIVE_FILTER_NONE);
assertEqualInt(archive_format(a), ARCHIVE_FORMAT_XAR);

f2(a, ae);
assertEqualInt(2, archive_file_count(a));
} else {
assertEqualInt(1, archive_file_count(a));
}

assertEqualInt(ARCHIVE_EOF, archive_read_next_header(a, &ae));

assertEqualIntA(a, ARCHIVE_OK, archive_read_close(a));
assertEqualInt(ARCHIVE_OK, archive_read_free(a));
free(buff);
}

{
struct archive* a;
struct archive_entry *entry = NULL;
size_t buf_size;
unsigned char *buf;

assert((a = archive_read_new()) != NULL);

if(ARCHIVE_OK != archive_read_support_filter_gzip(a)) {
skipping("Unsupported gzip");
assertEqualInt(ARCHIVE_OK, archive_read_free(a));
return;
}

if(ARCHIVE_OK != archive_read_support_filter_bzip2(a)) {
skipping("Unsupported bzip2");
assertEqualInt(ARCHIVE_OK, archive_read_free(a));
return;
}

if(ARCHIVE_OK != archive_read_support_format_xar(a)) {
skipping("Unsupported xar");
assertEqualInt(ARCHIVE_OK, archive_read_free(a));
return;
}

assertA(0 == archive_read_open_memory(a, d, s));


assertA(0 == archive_read_next_header(a, &entry));
buf_size = (size_t) archive_entry_size(entry);
assertA(buf_size == 12);
buf = (unsigned char*) malloc(buf_size);
assertA(NULL != buf);
assertA(buf_size == (size_t) archive_read_data(a, buf, buf_size));
free(buf);


assertA(0 == archive_read_next_header(a, &entry));
buf_size = (size_t) archive_entry_size(entry);
assertA(buf_size == 12);
buf = (unsigned char*) malloc(buf_size);
assertA(NULL != buf);
assertA(buf_size == (size_t) archive_read_data(a, buf, buf_size));
free(buf);

assertEqualInt(ARCHIVE_OK, archive_read_free(a));
}

